import styled from "styled-components";

const Login=(props)=>{
   return(
    <Container>
        <Content>
            <CTA>
                <CTALogoOne src="/Images/cta-logo-one.svg" alt=""></CTALogoOne>
                <SignUp>GET IT ALL THERE</SignUp>
                <Description>
                Subscription required.
                S$11.98/month or S$119.98/year and save over 15%.*
                *Savings compared to 12 months of the monthly subscription price.
                </Description>
                <CTALogoTwo src="/Images/cta-logo-two.png" alt=""></CTALogoTwo>

            </CTA>
            <BgImage/>
        </Content>
    </Container>
   );
};
const Container=styled.section`
    overflow: hidden;
    display: flex;
    flex-direction:column;
    text-align: center;
    height: 100vh;
`;


const Content = styled.div`
    margin-bottom: 10vw;
    width: 100%;
    position: relative;
    min-height: 100vh;
    box-sizing: border-box;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    padding:80px 40px;
    height:100%;
`;

const BgImage = styled.div`
    height:100%;
    background-position: top;
    background-size:cover ;
    background-repeat: no-repeat;
    background-image:url("/Images/login-background.jpg");
    position: absolute;
    top: 0;
    right: 0;
    left: 0;
    z-index:-1;

`;

const CTA=styled.div`
   max-width: 650px;
   width:100%;
   display: flex;
   flex-direction: column;

`
const CTALogoOne=styled.img`
     margin-bottom: 12px;
     max-width: 600px;
     min-height: 1px;
     display: block;
     width: 100%;
`
const SignUp=styled.a`
  font-weight: bold;
  color:white;
  background-color: #0063e5;
  margin-bottom: 12px;
  width:100%;
  letter-spacing:1.5px ;
  font-size: 18px;
  padding :16.5px;
  border: 1px solid transparent;
  border-radius: 6px;
  cursor: pointer;
  &:hover{
    background-color: #0483ee;
    
  }
`

const Description=styled.p`
  color:hsla(0,0%,95.3%,1);
  font-size: 11px;
  margin: 0 0 24px;
  line-height: 2;
  letter-spacing: 1.5px;
`
const CTALogoTwo=styled.img`
  max-width: 600px;
  margin-bottom: 20px;
  display:inline-block ;
  width:100%;
`
export default Login;
